CREATE TABLE UIT(
  S_No INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  Customer_Name VARCHAR(20) NOT NULL,
  Customer_ID VARCHAR(10) NOT NULL,
  Invoice_ID VARCHAR(10) NOT NULL,
  Invoice_Amount VARCHAR(18) NOT NULL,
